INSERT INTO `car_weibo` VALUES (70815, 17, '2020-07-09 11:00:04', '汽车之家', '#家家新闻#【AI看市场|解读大众途岳车型产品竞争力】上汽大众途岳于2018年10月31日上市，这款新车继承了途昂的设计语言，造型硬朗耐看。在紧凑型SUV市场上，上汽大众长期只有途观一款产品。即使途观的产品力再强大，这么多年过去之后，与咄咄相逼的同级别竞争对手相比还是有些缺乏竞争力，给紧凑型SUV车型注入新鲜血液就是上汽大众在这一级别市场上的当务之急了。所以，汲取途昂设计的途岳走进我们的视线之中。http://t.cn/A6yIFilP', 115, 23, 127, 'http://weibo.com/1761731257/JaqwVAX17');
INSERT INTO `car_weibo` VALUES (70816, 17, '2020-06-12 07:36:36', '乐天亚', '#途岳# 外观大气，配置还满意，油耗不高，中控台多采用采用软质材质，看起来做工在这个价钱上算有档次。不管是前排空间还是后备箱，我都非常满意。满载也没有觉得拥挤，空间挺大的，反正坐起很舒服！舒适度也是挺满意的呢#越野车# ​', 6, 11, 6, 'http://weibo.com/6137011969/J6iEWbUep');
