INSERT INTO `car_weibo` VALUES (70841, 18, '2020-07-28 01:21:08', 'H2O水弟弟', '异类的价格，顶尖的享受，试驾途观L插混/帕萨特插混<br>转载<br>在众多汽车品牌都已经开始发布插混车型或者纯电车型的时候，上汽大众却不为所动（事实上早已暗自涌动），直到2018年，上汽大众旗下的途观L插混以及帕萨特插混车型才正式投入市场，不过所谓好饭不怕晚，上汽大众在酝酿许久之后推出来的这两款插混车型的确非“善类”。近日上汽大众在厦门举办了旗下PHEV车型的试驾会，这也是疫情后上汽大众的首个线下活动，一天试驾下来，车神探对帕萨特插混和途观L插混已经有了很深刻的印象。<br>异类的价格，顶尖的享受，试驾', 21, 0, 0, 'http://weibo.com/1973632251/JdfRnlPZk');
