INSERT INTO `car_weibo` VALUES (70845, 18, '2020-06-15 08:29:32', '江苏交广大鹏', '#汽车# #我与汽车的日常# <br>听众淮安1群车主@东大勘测 ：我的2017年买的途观L，11万公里后变速箱紧急出现运行模式，经诊断说是机体单元坏了、换了机体单元后，现在一健起停时出抖动现象.故障码 U1121.求解。<br>答：既然维修完毕之后，车辆没有恢复正常状态，应该尽快回到原修理厂，注意！是原修理厂------这叫返工！而不是再找一家花两份钱维修！<br>U1121是大众专用故障码：数据总线信息丢失。<br>这个故障需要检查CAN线系统是否有线损、接头松动、受潮等问题。并请技师试车判断一键启停', 5, 8, 17, 'http://weibo.com/1492818770/J6LhUx1iR');
