INSERT INTO `car_weibo` VALUES (70863, 19, '2020-06-05 08:17:24', '王诗奇Mr兔', '奉子成婚，原来的A3有点小，预算30万上下。<br>想买台大的SUV，不要汉兰达，显得太老气了。<br>自己很喜欢雪佛兰的开拓者，又喜欢大众途昂的气场。<br><br>雪佛兰开拓者，颜值我也喜欢，雪佛兰这批车的外观年轻，帅气、锋芒，好看。并且动力水平很ok，缺点依然是内饰糙，中控糙，系统反应慢。<br>2.0T发动机，237马力350牛米，9挡手自一体。9秒破百<br><br>大众途昂空间大，动力系统没问题，其实这车性价比不错，30多万买个巨大的车，合适。缺点是底盘不够厚重，内饰沉闷。<br>2.0T发动', 123, 181, 6408, 'http://weibo.com/2189485651/J5eW1iIDm');
