INSERT INTO `car_weibo` VALUES (70867, 19, '2020-07-15 02:51:23', '吴昊小二郎', '【五号车论】同级别最引人注目的三个“唯一” 试全新福特探险者<br><br>这次参加了福特南区组织的试驾，从广州开到惠州。从暴雨到暴晒，从城区到高速，这一路已经是相当深度的体验了。<br><br>同级别三个唯一是：后驱平台、2.3T发动机和10AT。这是它相比较最直接对手：大众途昂和别克昂科旗最显著的优势。开起来也明显比上一代探险者操控更干脆利落。<br><br>对我来说，探险者的外观也绝对是让我心动的因素。还有那超级漂亮的21英寸轮圈搭配275的大轮胎，总之不是“颜控”的我都被它的造型深深折服。<br>', 37, 16, 56, 'http://weibo.com/2504345074/JbhTyBm4X');
