INSERT INTO `car_weibo` VALUES (70891, 21, '2020-07-21 11:19:03', '郑谊-', '【问】：速腾280舒适和探歌280舒适选哪个比较好？<br>【答】：我比较推荐 速腾，两款车的动力总成是一模一样，就是配置区别。速腾的后排更大，更舒服。配置够用。 探歌舒适版多了 主动刹车，8英寸中控屏，速腾舒适只有6.5英寸屏。但速腾在内饰用料以及高速行驶状态还不错。而且这两款车应该是速腾更便宜一些。', 297, 3, 12, 'http://weibo.com/2718503193/JcfMB04oq');
