INSERT INTO `car_weibo` VALUES (70906, 21, '2020-03-27 06:31:04', '张彦钧-Kevin', '最近疯狂痴迷紧凑型高性能SUV！黄色丰田CHR GR-Sport虽然外观内饰+手动挡很香，但1.2T的弱鸡动力连国内2.0自吸奕泽都跑不过，然后我看到了这个！大众探歌R！300马力！四驱！4.8秒破百！原厂天蝎排气！外观也很帅，不过我看到这车，总会想起之前那辆长时间堵车离合器就会发出糊味儿的探歌，真不是黑，而是我怕了，如果这个蓝色的小家伙堵车不会变身糊歌R的话，那应该还是很香的！哦～对了！最后我估算了下价格，如果进到国内，差不多30-40w[馋嘴]#凯文聊车#', 5, 63, 64, 'http://weibo.com/2142824563/IAxMqyC76');
