INSERT INTO `car_weibo` VALUES (70913, 22, '2020-06-19 04:01:18', '渗透地面的爱', '六月#宜家新裤子小怪兽#，白天骄阳似火，天似个火炉。我被烤着，仿佛只有我被烤着。天空荡荡的，我抬头看不见太阳，遥远的绿色被热浪遮掩，只见浅浅的蓝。我看不到太阳，是我没有那勇气#探影盛夏礼遇季#，不敢寻找天上的太阳!我看不到太阳，因为我心里有一个太阳，我想回避，似在逃避。http://t.cn/A62dUHCI', 71, 21, 139, 'http://weibo.com/5290900877/J7lf1mHSn');
