INSERT INTO `car_weibo` VALUES (70971, 25, '2020-06-22 06:11:07', '车坛快报', '“套娃”一直都是大众汽车的设计风格，家族式的设计语言让不懂车的人很难分辨部分车型的区别，于是就有了“高尔夫”拉长拍扁加宽的各种段子。现在又一款大众SUV开始延续这一做法：大众在探岳SUV车型基础上，推出探岳X车型，就正如途昂和途昂X的区别一样，探岳X是溜背酷跑版本的探岳，同时也是缩小版的途昂X。大众这“套娃”的玩法，产品库倒是越来越丰富，产品给人的印象，却越来越弱了#大众#', 270, 123, 539, 'http://weibo.com/5723337681/J7OncB84s');
