INSERT INTO `car_weibo` VALUES (70987, 26, '2020-07-31 13:00:04', '梨视频', '#途锐与你尽览时间上的中国# <br>未时，途锐与国内旅行博主@北魏先生Bevan 前往东川红土地，寻访大地艺术的创作者。眼前美景的背后，是东川人朴质而惊人的创造力。他们让我们相信，每一种努力，都不会被辜负。辰时，@大众进口汽车 途锐携手 @了不起的匠人 出品人/总导演 望哥 ，来到徽墨之乡——安徽·宣城。看徽墨守艺人，如何传承千年墨韵。http://t.cn/A6L7K5ZR http://t.cn/A6UytD5o', 326, 112, 1261, 'http://weibo.com/6004281123/JdMIz1t3u');
INSERT INTO `car_weibo` VALUES (70988, 26, '2020-07-31 13:00:05', '夏弃疾_', '#途锐与你尽览时间上的中国# <br>徽墨“拈来轻，磨来清、嗅来馨、坚如玉、研无声”，美誉传天下，一墨倾古今。辰时，@大众进口汽车 途锐与@了不起的匠人 出品人/总导演 望哥 共同启程，来到徽墨之乡——安徽·宣城。在墨香四溢的古韵工坊，感受墨师一丝不苟的匠人精神。时间洗礼之下，唯有匠心不变，才能铸就不凡。  http://t.cn/A6UUh7lx', 28, 39, 97, 'http://weibo.com/5874507153/JdMIzCPv0');
INSERT INTO `car_weibo` VALUES (70989, 26, '2020-07-24 13:00:04', 'yumi', '#途锐与你尽览时间上的中国#\n穿越亚欧非，横跨数万里，千年前的海上丝绸之路，写下一段乘风破浪的不朽篇章。巳时，环球旅行家/汽车博主@一脚油门儿 与@大众进口汽车 途锐一起，共赴海上传奇伊始之地——福建·泉州，感受陆海相通的勇气和智慧，如何让古老的文明万里交融。 http://t.cn/A6ygVA5f ​', 638, 1315, 9436, 'http://weibo.com/2311975635/JcIJ5qzhg');
INSERT INTO `car_weibo` VALUES (70990, 26, '2020-07-03 05:55:50', '王诗奇Mr兔', '总结了一下，预算60万，买SUV。<br>路况会差，要去工地，自驾游，空间都需求。<br>现在开途乐4.0，感觉动力不爽，想换个动力储备足，底气足的车。<br>自己琢磨二手途乐5.6或者路虎发现5。<br><br>其实你的选择很多。如果对乘坐品质和驾驶品质有追求，3.0T的途锐带空气悬架，应该是能满足你的需求。空气悬架带来的舒适度绝对是一流，越野时升高，公路降低，没问题，6缸增压车型340马力450牛米，搭配机械四驱，越野能力不差的。<br><br>其次路虎发现5，但发现5后排不是很舒服，内饰不够豪华，就', 3616, 268, 20804, 'http://weibo.com/2189485651/J9tYsxQQ7');
