INSERT INTO `car_weibo` VALUES (70994, 26, '2020-07-22 13:00:02', 'Abby45', '#途锐与你尽览时间上的中国#\n巍峨壮丽、神秘莫测的梅里雪山，被《中国国家地理杂志》评选为中国十大名山之一，是世界旅人心中的圣地。酉时，旅行博主@大漠的旅行V 和@大众进口汽车 途锐再次踏上神圣的旅程，去寻觅梅里雪山难得一见的十三峰全貌。他们能够如愿以偿么？ http://t.cn/A6y1yv7r ​', 244, 524, 728, 'http://weibo.com/1416671622/JcpS5oFFa');
INSERT INTO `car_weibo` VALUES (70995, 26, '2020-07-24 13:00:04', '梨视频', '#途锐与你尽览时间上的中国#<br>酉时，@大众进口汽车 途锐与曾经目睹过梅里雪山「日照金山」的旅行博主@大漠的旅行V 再次踏上旅程，寻觅难得一见的十三峰全貌。唯有不追求结果，才能真正享受过程。巳时，途锐携手环球旅行家/汽车博主@一脚油门儿 ，共赴海上丝绸之路的起点福建·泉州，重温历史盛景，回顾盛极一时的辉煌过往。http://t.cn/A6L7K5ZR http://t.cn/A6ygPw8j', 309, 103, 1258, 'http://weibo.com/6004281123/JcIJ5mbKp');
