INSERT INTO `car_weibo` VALUES (70997, 26, '2020-06-15 04:30:01', '谷岳', '#途锐与你尽览时间上的中国#\n寅时：我自驾到山东东营，在黄河入海口等待日出。 \n日出对我来说就是希望，而人生就像一条河流，经过一路曲折的打磨，最终突破自我极限，汇入大海，到达更大的世界。 \n勇往直前，本身就是一种意义。\n @大众进口汽车  http://t.cn/A6L4nMsV ​', 123, 103, 655, 'http://weibo.com/1611853174/J6JIHjp3h');
