INSERT INTO `car_weibo` VALUES (70999, 26, '2020-07-17 13:00:03', '梨视频', '#途锐与你尽览时间上的中国#<br>申时，@大众进口汽车 途锐携手美食主持人刘仪伟寻味川菜巅峰，百年宫廷菜——开水白菜。尝尽百味，最终归于平静，这就是人生真味。午时，途锐携手作家 /Vlogger @白嵩 ，前往苗族世代相传地贵阳，感受苗绣的极致魅力。看纯粹东方美学，如何诠释生生不息。http://t.cn/A6L7K5ZR http://t.cn/A6yYbOrm', 304, 122, 1037, 'http://weibo.com/6004281123/JbEJBFNcD');
INSERT INTO `car_weibo` VALUES (71000, 26, '2020-06-16 13:00:03', '梨视频', '#途锐与你尽览时间上的中国# INSERT INTO `car_weibo` VALUES (71001, 26, '2020-06-01 11:15:54', '王诗奇Mr兔', '预算65万想买个SUV，不要日系不要宝马。<br>这选择其实很多，很多。<br>性价比十足的选择是大众途锐，标准纵置四驱，空气悬架，越野性能和舒适性都有。德系底盘质感也能保留。缺点是非豪华品牌[允悲]<br><br>同样你可以看看路虎发现第五代。<br>中大型SUV传统豪强，只是换代后，颜值丑了，内饰不豪华，后排不舒服，但机械没问题[doge][doge][doge]<br><br>沃尔沃XC90，横置四驱，其实是实力也很强。[doge]<br><br>那么问题来了[嘻嘻] http://t.cn/A62', 65, 209, 10365, 'http://weibo.com/2189485651/J4EougZkL');
INSERT INTO `car_weibo` VALUES (71003, 26, '2020-06-24 13:00:01', '团子E菲', '#途锐与你尽览时间上的中国#\n人生就像一条河流，乘风破浪，步履不停，最终汇入大海，看到更广阔的世界。途锐携手20多年旅行生涯的环球旅行者-@谷岳 ，寅时，东营，黄河入海最后一公里，见证绝妙的壮阔日出。戳视频，跟随途锐和谷岳，开启一场“追寻自我”之旅。 http://t.cn/A6LHRDtk ​', 334, 407, 938, 'http://weibo.com/1691991065/J89Uariow');
