INSERT INTO `car_weibo` VALUES (71005, 26, '2020-07-31 13:00:05', '一手Video', '#途锐与你尽览时间上的中国#<br>徽墨“拈来轻，磨来清、嗅来馨、坚如玉、研无声”，美誉传天下，一墨倾古今。辰时，@大众进口汽车 途锐与@了不起的匠人 出品人/总导演 望哥 共同启程，来到徽墨之乡——安徽·宣城。在墨香四溢的古韵工坊，感受墨师一丝不苟的匠人精神。时间洗礼之下，唯有匠心不变，才能铸就不凡。 http://t.cn/A6UUh7Yc', 212, 105, 394, 'http://weibo.com/5943595658/JdMIzDVlU');
INSERT INTO `car_weibo` VALUES (71006, 26, '2020-07-23 13:30:04', '爱车的诺诺', '#【事故车医院】#途锐来了！3年车龄5万公里，比行情价低7万！<br>终于，它来了！那台早早露脸却始终排不上队的途锐，来了！<br>作为一台大众集团的旗舰SUV，途锐自然是头铁身硬。虽然这次事故让它流落到了诺诺手里，但实际伤害并不大，我们的零件成本也不是特别高。只是反反复复有很多小毛病，让我们耗费了太多人力和时间。但这不是大事，因为诺总不用出钱，他不觉得这是什么大问题。<br><br>正常来说，同年份、里程差不多的途锐要40万左右的价格，而这台《事故车医院》出品的全损途锐只要33万多几块钱，在本就不多的二', 5, 9, 39, 'http://weibo.com/1951134120/JczuLxnZC');
