INSERT INTO `car_weibo` VALUES (71019, 27, '2020-07-10 04:30:03', '黄琦宁', '#黄司机[超话]# #黄司机带你看新车# 日前，我们从海外媒体获得了一组大众高尔夫Alltrack车型的路试谍照。据悉，新车将不会在美国发售，仅会提供给欧洲等其他地区。动力方面，我们预计高尔夫Alltrack会配备汽油和柴油发动机两种动力形式，并匹配双离合变速箱和4MOTION四驱系统。值得一提的是，有传言大众或将在这一代Alltrack上提供前轮驱动。另外，不久前发布的Tiguan R以及Arteon R都让我们眼前一亮，我们希望高尔夫 R旅行版也能继续出现在这一代上面。', 106, 14, 135, 'http://weibo.com/1856693732/Jaxp7riqG');
