INSERT INTO `car_weibo` VALUES (71025, 27, '2020-05-18 23:31:03', '易车', '#新车速递#【新款大众Tiguan X渲染图曝光 预计年内发布 中国市场或将首发】日前，大众Tiguan X的渲染图曝光，渲染图根据此前大众Tiguan X谍照而创作。预计轿跑SUV造型的Tiguan X将在今年年内发布，而首发市场很可能将是中国。为了保证车顶线条的流畅度，车尾有所加长，这将扩大行李空间并让车身保持流畅的比例。Tiguan R上配备的333马力的2.0T涡轮增压发动机或许也会出现在Tiguan X上。', 16, 60, 69, 'http://weibo.com/1912222221/J2BdW6ijv');
