INSERT INTO `car_weibo` VALUES (71034, 28, '2018-09-30 04:00:55', '上汽大众', '#上汽大众·微播报#大众全球首款插电式混合动力SUV途观L插电式混合动力版已于上海、杭州、深圳等8大城市开启预售，并将于近期上市。新车提供混动豪华版和混动旗舰版两款车型，综合补贴后建议预售价分别为29.98万元和30.98万元。  http://t.cn/EPDHbZ4 ​', 100, 63, 311, 'http://weibo.com/3865917418/GBJdZAvmQ');
INSERT INTO `car_weibo` VALUES (71035, 28, '2018-08-02 06:50:03', '汽车洋葱圈', '#葱爆新车# 【油耗降到1.9L/100km的途观L你买不买？大众途观L PHEV或年内上市！】大众途观在国人心中地位不可撼动，途观 L的换新上市，更是巩固了它的地位。如今在新能源的大趋势下，途观L也将迎来 PHEV版本，也就是插电式混动车型。新车将搭载一台1.4T发动机（和现款参数一致，最大马力150匹，最大扭矩250牛·米）和一台电动机（动力蓄电池组总能量为12kw·h，可纯电行驶52km），新车的综合最大马力达到218匹。而它的综合油耗仅为1.9L/100km！途观L PHEV将采用与车身同色包围，', 18, 90, 52, 'http://weibo.com/5310047613/GsM7lyqVL');
