INSERT INTO `car_weibo` VALUES (71044, 29, '2020-03-26 04:01:03', '易车', '#新车速递#【一汽-大众探岳GTE将于4月25日上市 插电混动中型SUV】探岳GTE是一汽-大众体系内首款插电式混动SUV，与2019年底上市的迈腾GTE形成大众品牌中高端PHEV车型的布局。大众探岳GTE将搭载1.4TSI发动机+电动机组成的PHEV插电式混合动力系统，系统功率以及三元锂电池的容量暂时还未公布。而根据申报信息看，探岳GTE的百公里综合油耗仅为2.0升。', 4, 16, 27, 'http://weibo.com/1912222221/IAnn2fNIV');
INSERT INTO `car_weibo` VALUES (71045, 29, '2020-04-25 11:16:03', '新浪汽车', '#新车情报局# 一汽-大众探岳GTE正式上市，2款车型售价24.98-25.98万元。\n作为大众探岳的插电混动版车型，搭载由1.4T发动机和电动机组成的插混系统，系统综合最大功率211马力，最大扭矩400牛·米；传动匹配DQ400e变速箱，变速箱体内部集成了电机。这个价格怎么样？[doge] ​', 9, 14, 27, 'http://weibo.com/1644088831/IEZ2v3VFi');
