INSERT INTO `car_weibo` VALUES (71049, 29, '2020-03-07 04:07:18', '黄琦宁', '#黄司机[超话]# #黄司机带你看新车# 日前，我们从一汽-大众官方获悉，探岳GTE正式下线。探岳是一汽-大众旗下的全新中型SUV车型，而此次下线的车型为该车的插电式混动版本。 【动力方面】探岳GTE搭载由1.4T涡轮增压发动机和电动机组成的插电式混合动力系统，其中发动机最大功率为150Ps。电池方面，新车将匹配宁德时代提供的三元锂电池，但容量未知。', 64, 25, 136, 'http://weibo.com/1856693732/Ixui95UEy');
