INSERT INTO `car_weibo` VALUES (71051, 30, '2020-03-02 08:39:03', '网上车市', '#车市速递# 【大众R家族最新成员上场 全新途锐R“开箱”解读】大众的R系列车型往往代表着各自车系的最高性能，绝对是许多“德粉”心中图腾般的存在。不久之前，大众R系列的最新成员终于亮相，令所有人大跌眼镜的是，它不但是辆大SUV，而且还配了一套插电混动系统！这就是本文的主角：全新途锐R。一辆SUV能不能称得上是真正的“R”！<br>#SUV# #德系车#', 25, 66, 105, 'http://weibo.com/1779884443/IwKVXq7xQ');
