INSERT INTO `car_weibo` VALUES (71053, 30, '2020-02-25 10:16:22', '黄琦宁', '#黄司机[超话]# #黄司机带你看新车# 日前，大众汽车官方正式发布了途锐R车型的官图，新车作为大众R系列性能版车型，首次采用了插电混合动力系统，最大功率可达462Ps，新车将于2020日内瓦车展正式亮相。【动力方面】途锐R采用3.0T V6汽油发动机和电机（电池容量为14.1 kWh）组成的插电混动系统，前者最大功率340Ps，后者最大功率136Ps，这套系统的综合最大功率462Ps，综合峰值扭矩700N·m，极速可达250km/h，传动系统匹配8速自动变速箱并搭载4MOTION四驱系统。', 66, 26, 121, 'http://weibo.com/1856693732/IvR0ucAAw');
