INSERT INTO `car_weibo` VALUES (71057, 30, '2020-02-25 09:20:11', '何老师说车秀', '大众途锐R发布，是真正的大众R，不是加个运动套件的R-line版，外观是专属的R运动套件，内饰也有多出R标识，是大众新的R标，简洁多了，但不如老的好看。<br><br>它是大众首款采用插电混动的R车型，2.9升V6涡轮增压发动机+双电机，没错来自保时捷的技术，综合最大输出462马力，700牛米，匹配8AT，0-100km/h加速时间在5秒内，极速限制在250km/h。<br>另外，途锐R还支持纯电模式，极速为140km/h。大众途锐R将于2020年3月日内瓦车展正式亮相，不知道日内瓦车展会不会受到疫情影响', 7, 5, 10, 'http://weibo.com/6696895614/IvQDGiTbQ');
