INSERT INTO `car_weibo` VALUES (71064, 30, '2015-01-16 05:16:35', '汽车营销分析', '【大众海兹曼:希望新能源车补贴一视同仁】大众中国总裁兼CEO海兹曼提出，新能源汽车发展初期，由于成本高昂，需要政府的政策和补贴扶持，“目前中国已有这样的政策和补贴，但希望能一视同仁，无论进口、国产都享受补贴。”未来大众将推多款插电混动车型，包括辉腾途锐A8和Q7等。http://t.cn/RZCcIKm ​', 17, 21, 6, 'http://weibo.com/1742013781/BFNMuw554');
